import { Route,Routes } from "react-router-dom";
function App() {
  return (
    <div style={{ margin: 0, padding: 0 }}>

      <Routes>
        <Route exact path="/" element={<MainPage />} />
        <Route exact path="/search" element={<SearchPage />} />
        <Route exact path="/detail"  />
    </Routes>     


   </div>
  );
}

export default App;
